<link rel="stylesheet" href="http://localhost/Wordpress/wordpress/wp-content/themes/wp_assert_contabilidade/components/banner/style.css" />
<link rel="stylesheet" href="http://localhost/Wordpress/wordpress/wp-content/themes/wp_assert_contabilidade/components/button/default/style.css" />
<script src="http://localhost/Wordpress/wordpress/wp-content/themes/wp_assert_contabilidade/components/button/default/script.js"></script> 


<script>
    let
        radios = [],
        sliders = [],
        controls = [],
        banners = [
            {
                image: 'data:image/webp;base64,',
                msg: 'descubra como a <strong>contabilidade para bares, lanchonetes e restaurantes</strong> pode alavancar o seu negcio!',
                btn_text: 'saiba mais',
                btn_url: 'contabilidade-para-bares-restaurantes-e-lanchonetes'
            },
            {
                image: 'data:image/webp;base64,',
                msg: 'ter o suporte de uma <strong>contabilidade para nutricionistas e consultrio de nutrio</strong> pode ser a chave para o alcance do xito!',
                btn_text: 'saiba mais',
                btn_url: 'contabilidade-para-nutricionistas-e-consultorios-de-nutricao'
            },
            {
                image: 'data:image/webp;base64,',
                msg: 'descubra como a <strong>contabilidade para clnicas veterinrias e pet shop</strong> pode melhorar os resultados no seu negcio!',
                btn_text: 'saiba mais',
                btn_url: 'contabilidade-para-clinicas-veterinarias-e-pet-shop'
            }
        ]

    banners.map((banner, index) => {

        radios.push(
            `<input type="radio" name="slider" id="slide_${index}" ${index === 0 ? 'checked' : ''} />`
        )

        sliders.push(
            `<div style="left: ${`${index * 100}%`};" class="slide_filter"></div>

            <div 
                style="background-image: url(${banner.image});${index !== 2 && 'background-position: center;'} " 
                class="slide slide_image slide_${index}">

                <div class="slide slide_content slide_content_${index}">

                    <span class="slide_content_msg">
                        ${banner.msg}
                    </span>

                    <span>
                    ${
                        getDefaultButton(banner.btn_text, banner.btn_url)
                    }
                    </span>

                </div>

            </div> `
        )

        controls.push(
            `<label for="slide_${index}"></label>`
        )

    })
</script>


<section id="banner_section">

    <script>
        document.write(radios.map(radio => (radio)))
    </script>


    <article id="banner_article_sliders">
        <article id="sliders">
            <div id="inner" class="inner"></div>
        </article>
    </article>


    <article id="banner_article_controls"></article>

</section>


<script>
    document.getElementById('inner').innerHTML = sliders.map(slide => (slide))
    document.getElementById('banner_article_controls').innerHTML = controls.map(control => (control))
</script>